pragma solidity ^0.5.0;

contract Gst {
    uint256 public merchantUserCount = 0;
    mapping(uint256 => Users) public usersMap;
    struct Users {
        uint256 id;
        address payable addr;
        string firstName;
        string lastName;
        uint256 balance;
        string email;
        string gstNumber;
        string userType;
    }

    function createAccount(
        uint256 _id,
        string memory _firstName,
        string memory _lastname,
        uint256 _balance,
        string memory _email,
        string memory _gstNumber,
        string memory _userType
    )
        public {
            merchantUserCount ++;
            usersMap[merchantUserCount] = Users(_id, msg.sender, _firstName, _lastname, _balance, _email, _gstNumber, _userType);
    }

    function test(uint256 _senderId) public payable{
        usersMap[_senderId].addr.transfer(msg.value);
    }
}
